import React from  'react';
import ReactDOM from 'react-dom';
import Card from './Card';

ReactDOM.render(
    <>
    <Card sname="Stranger's Things" pic="https://upload.wikimedia.org/wikipedia/en/f/f7/Stranger_Things_season_2.jpg"></Card>
    <Card sname="Dark" pic="https://resizing.flixster.com/Xr7qz5Sc9FbC2Ed_znk1QdK-TKw=/ems.ZW1zLXByZC1hc3NldHMvdHZzZXJpZXMvUlRUVjI2NjgyOS53ZWJw"></Card>
    <Card sname="HellBound" pic="https://www.ladbible.com/cdn-cgi/image/width=720,quality=70,format=jpeg,fit=pad,dpr=1/https%3A%2F%2Fs3-images.ladbible.com%2Fs3%2Fcontent%2Fcd1b5e58619e587aff0e5c55f4f1817d.png"></Card>
    <Card sname="The Haunting of hill House"></Card>
    </>,
    document.getElementById("root")
)
